import { useState } from 'react';

export const themeOptions = (props) => {
  if(props.mode && typeof props.mode === 'string'){
    return ({
      palette: {
        mode: props.mode,
        primary: {
          main: '#7c4dff',
        },
        secondary: {
          main: '#f50057',
        },
      },
    })
  }
};
